import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function ForeCastText(props) {
    let { 
        location: {
            name
        }, 
        current: {
            temp_c, 
            condition: {
                icon
            }
        } 
    } = props.weather;

    console.log("props",props);

    return (    
        <Row>
            <Col>
                <Col>
                    <span>{name}</span>
                </Col>

                <Col>
                    <span>{temp_c}&deg;C</span>
                </Col>
            </Col>

            <Col>
                <img src={`${icon}`} />
            </Col>
        </Row>
    )
}

export default ForeCastText;
